const scraped = $('Get Dataset Items').all();
const existing = $('Read Existing Job IDs').all();
const ids = new Set(existing.map(r => r.json['Job ID']).filter(Boolean));
const newJobs = scraped.filter(j => !ids.has(j.json.uid));
if (!newJobs.length) return [{ json: { _noNewJobs: true } }];
return newJobs;

const items = $input.all();
return items.map(item => {
  const j = item.json;
  let budget = j.budget?.hourlyRate?.min ? `$${j.budget.hourlyRate.min}-${j.budget.hourlyRate.max}/hr` : (j.budget?.fixedBudget ? `$${j.budget.fixedBudget}` : 'N/A');
  return { json: { jobId: j.uid, title: j.title, description: j.description, budget, url: j.externalLink, skills: (j.skills||[]).join(', '), postedAt: j.createdAt, clientVerified: j.client?.paymentVerified ? 'Yes' : 'No', clientSpent: j.client?.totalSpent || 0 }};
});

const items = $input.all();
const orig = $('Normalize Fields').all();
return items.map((item, i) => {
  let p = {};
  try { p = JSON.parse((item.json.message?.content || '{}').replace(/```json?|```/g, '').trim()); } catch(e) {}
  return { json: { ...orig[i]?.json, score: p.score || 0, decision: p.decision || 'SKIP', reasoning: p.reasoning || '' }};
});

let scraped = 0, passed = 0;
try { scraped = $('Get Dataset Items').all().length; } catch(e) {}
try { passed = $('Parse AI Score').all().filter(j => j.json.score >= 60).length; } catch(e) {}
return [{ json: { timestamp: new Date().toISOString(), scraped, passed }}];
